        $stateProvider
          .state({
            name: 'index',
            url: '',
            controller: 'AppHomeCtrl',
            templateProvider: ['$q', ($q) => {

              const deferred = $q.defer();

              require.ensure(['../app-home/index.html'], () => {
                const template = require('../app-home/index.html');
                deferred.resolve(template);
              });

              return deferred.promise;
            }],
            resolve: {
